http {
    include /etc/nginx/mime.types;
    default_type application/octet-stream;

    # å¢åŠ  client_max_body_size æŒ‡ä»¤ï¼Œè®¾ç½®è¯·æ±‚ä½“çš„æœ€å¤§å¤§å°ä¸º50M
